// Verified cash manager on mainnet
// (c) Kallol Borah, 2021

pragma solidity 0.5.7;
pragma experimental ABIEncoderV2;

import "./interfaces/ICash.sol";
import "./interfaces/IBond.sol";
import "./interfaces/IFactory.sol";
import "./interfaces/IRates.sol";
import "./utilities/Pausable.sol";
import "./utilities/StringUtils.sol";
import "abdk-libraries-solidity/ABDKMathQuad.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/ownership/Ownable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC20/ERC20.sol";

contract Cash is ICash, ERC20, Ownable, Pausable {

    using stringutils for *;

    using ABDKMathQuad for uint256;
    using ABDKMathQuad for int256;
    using ABDKMathQuad for bytes16;

    //bridge
    address bridge;

    //mutex
    bool lock;

    //name of Verified cash token (eg, Via-USD)
    string public name;
    string public symbol;
    bytes32 public cashtokenName;

    //verified factory address
    IFactory private factory;

    //verified rates
    IRates private rates;

    struct deposit{
        bytes16 depositAmount;
        bytes16 issuedAmount;
    }

    //mapping of buyers (address) to currency (bytes32) to deposits 
    mapping(address => mapping(bytes32 => deposit)) private L1deposits;
    mapping(address => mapping(bytes32 => deposit)) private L2deposits;

    //supported ERC20 tokens for issuing Verified cash tokens
    ICash.token[] private tokens;
    mapping(address => uint256) private tokenIndex;

    //events to capture by Verified bridge
    event CashIssueRequest(address indexed party, bytes32 currency, uint256 amount);
    event CashRedeemed(address indexed redeemer, bytes32 currency, uint256 amount);
    event CashTransfer(address indexed transferor, address transferee, bytes32 currency, uint256 amount);
    event CashIssued(address indexed party, bytes32 currency, uint256 amount);
    event addedL2Balance(address indexed party, bytes32 currency, uint256 amount);
    event transferredL2Balance(address indexed transferor, address transferee, bytes32 currency, uint256 amount);

    function initialize(bytes32 _name, bytes32 _currency, address _owner, address _fee, address _bridge) public initializer{
        Ownable.initialize(_owner);
        factory = IFactory(msg.sender);
        name = string(abi.encodePacked(_name));
        symbol = _name.substring(0,5);
        cashtokenName = _currency;
        rates = IRates(_fee);
        bridge = _bridge;
        lock = false;
    }

    function setSigner(address _signer) onlyOwner external{
        bridge = _signer;
    }

    //handling pay in of ether for issue of via cash tokens
    function() external payable{
        //ether paid in
        require(msg.value !=0);
        //only to pay in ether
        require(msg.data.length==0);
        //contract must not be paused
        require(paused == false);
        //check aml status
        //require(amlCheck(msg.sender)==true);     
        L1deposits[msg.sender]["ether"].depositAmount = ABDKMathQuad.add(L1deposits[msg.sender]["ether"].depositAmount, ABDKMathQuad.fromUInt(msg.value));    
    }

    /**
        Specifies list of supported tokens that can be deposited to issue Verified cash tokens
        @param  _token  address of token supported
        @param  _name   name of token supported
     */
    function supportTokens(address _token, bytes32 _name) onlyOwner external {
        if(tokenIndex[_token]==0){
            ICash.token memory t = ICash.token ({
                tokenName: _name,
                tokenAddress: _token
            });
            tokens.push(t);
            tokenIndex[_token] = tokens.length;
        }
    }

    /**
        Checks if a specified token is supported for issuing Verified cash tokens
        @param  _token  token that is supported for issuing cash tokens
     */
    function checkSupportForToken(address _token) external view returns(bool){
        if(tokenIndex[_token]>0)
            return true;
        else
            return false;
    }

    /**
        Returns array of tokens supported
     */
    function getSupportedTokens() external view returns(ICash.token[] memory){
        return tokens;
    }
    
    /**
        Used by external apps (eg, exchange, wallet) to buy Verified cash token 
        @param  _token  address of token used by investor to buy the cash token
        @param  _amount amount of token that is transferred from investor to this cash token issuing contract
     */    
    function requestIssue(address _token, uint256 _amount, address _buyer) external {
        require(paused == false, "Contract in paused state");
        bool found = false;
        if(tokenIndex[_token]>0)
            found = true;
        if(found){            
            _approve(msg.sender, address(this), _amount);
            bytes32 currencyName = tokens[tokenIndex[_token]-1].tokenName;
            if(ERC20(_token).transferFrom(msg.sender, address(this), _amount)){
                L2deposits[_buyer][currencyName].depositAmount = ABDKMathQuad.add(L2deposits[_buyer][currencyName].depositAmount, ABDKMathQuad.fromUInt(_amount));
                emit CashIssueRequest(_buyer, currencyName, _amount);
            }
        }
        else if(ABDKMathQuad.cmp(L1deposits[msg.sender]["ether"].depositAmount, ABDKMathQuad.fromUInt(_amount))>=0){
            L1deposits[msg.sender]["ether"].depositAmount = ABDKMathQuad.sub(L1deposits[msg.sender]["ether"].depositAmount, ABDKMathQuad.fromUInt(_amount));
            L2deposits[_buyer]["ether"].depositAmount = ABDKMathQuad.add(L2deposits[_buyer]["ether"].depositAmount, ABDKMathQuad.fromUInt(_amount));
            emit CashIssueRequest(_buyer, "ether", _amount);                
        }
    }
    
    //adds issued Verified cash tokens in L2 to user balances
    function addIssuedBalance(uint256 balance, address buyer, bytes32 currency, bytes32 _hashedMessage, uint8 _v, bytes32 _r, bytes32 _s) 
                            external {
        bytes32 payloadHash = keccak256(abi.encode(_hashedMessage, "L2toL1"));
        bytes32 messageHash = keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", payloadHash));
        require(ecrecover(messageHash, _v, _r, _s)== bridge);        
        if(factory.getIssuer("ViaCash", currency)==address(this)){
            emit addedL2Balance(buyer, currency, SafeMath.sub(balance, ABDKMathQuad.toUInt(L2deposits[buyer][currency].issuedAmount)));
            L2deposits[buyer][currency].issuedAmount = ABDKMathQuad.fromUInt(balance);
        }
    }
    
    //transfers deposit (against which cash tokens are issued) from transferor to transferee in L2   
    function transferDeposit(address transferor, uint256 amount, address transferee, bytes32 currency, bytes32 _hashedMessage, uint8 _v, bytes32 _r, bytes32 _s) 
                            external {
        bytes32 payloadHash = keccak256(abi.encode(_hashedMessage, "L2toL1"));
        bytes32 messageHash = keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", payloadHash));
        require(ecrecover(messageHash, _v, _r, _s)== bridge);
        if(ABDKMathQuad.cmp(ABDKMathQuad.sub(L2deposits[transferor][currency].depositAmount, ABDKMathQuad.fromUInt(amount)),0)>=0){    
            ABDKMathQuad.sub(L2deposits[transferor][currency].depositAmount, ABDKMathQuad.fromUInt(amount));
            ABDKMathQuad.add(L2deposits[transferee][currency].depositAmount, ABDKMathQuad.fromUInt(amount));
            emit transferredL2Balance(transferor, transferee, currency, amount);
        }
    }
    
    //redeems deposited amounts in L2
    function redeemDeposits(uint256 amount, address redeemer, bytes32 currency, uint256 balance, bytes32 _hashedMessage, uint8 _v, bytes32 _r, bytes32 _s) 
                            external {
        bytes32 payloadHash = keccak256(abi.encode(_hashedMessage, "L2toL1"));
        bytes32 messageHash = keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", payloadHash));
        require(ecrecover(messageHash, _v, _r, _s)== bridge);
        L2deposits[redeemer][currency].issuedAmount = ABDKMathQuad.fromUInt(balance);        
        if(currency=="ether"){    
            address(uint160(redeemer)).transfer(amount);
            L2deposits[redeemer][currency].depositAmount = ABDKMathQuad.sub(L2deposits[redeemer][currency].depositAmount, ABDKMathQuad.fromUInt(amount));
        }
        else{
            for(uint256 i=0; i<tokens.length; i++){
                if(tokens[i].tokenName==currency){
                    ERC20(tokens[i].tokenAddress).transfer(redeemer, amount);
                    L2deposits[redeemer][currency].depositAmount = ABDKMathQuad.sub(L2deposits[redeemer][currency].depositAmount, ABDKMathQuad.fromUInt(amount));
                }
            }
        }  
        emit CashRedeemed(redeemer, currency, amount);
    }

    //transfers issued cash tokens in L2 to L1 wallet
    function transferIssuedBalance(address transferor, bytes32 currency, uint256 amount, uint256 deposited, bytes32 _hashedMessage, uint8 _v, bytes32 _r, bytes32 _s) 
                            external {
        bytes32 payloadHash = keccak256(abi.encode(_hashedMessage, "L2toL1"));
        bytes32 messageHash = keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", payloadHash));
        require(ecrecover(messageHash, _v, _r, _s)== bridge);
        L2deposits[transferor][currency].depositAmount = ABDKMathQuad.sub(L2deposits[transferor][currency].depositAmount, ABDKMathQuad.fromUInt(deposited));
        L1deposits[transferor][currency].depositAmount = ABDKMathQuad.add(L1deposits[transferor][currency].depositAmount, ABDKMathQuad.fromUInt(deposited));
        _mint(address(this), amount);
        _transfer(address(this), transferor, amount);
        L2deposits[transferor][currency].issuedAmount = ABDKMathQuad.sub(L2deposits[transferor][currency].issuedAmount, ABDKMathQuad.fromUInt(amount));
        L1deposits[transferor][currency].issuedAmount = ABDKMathQuad.add(L1deposits[transferor][currency].issuedAmount, ABDKMathQuad.fromUInt(amount));
        emit CashIssued(transferor, cashtokenName, amount);
    }

    //overriding this function of ERC20 standard for transfer of via cash tokens to other users or to this contract for redemption
    function transferFrom(address sender, address receiver, uint256 token) public returns (bool){
        //contract must not be paused
        require(paused == false);
        //check aml status
        //require(amlCheck(sender)==true);
        //require(amlCheck(receiver)==true);
        //ensure sender has enough tokens in balance before transferring or redeeming them
        require(ABDKMathQuad.cmp(ABDKMathQuad.fromUInt(balanceOf(sender)),ABDKMathQuad.fromUInt(token))>=0);
        //check if tokens are being transferred to this cash contract
        if(receiver == address(this)){
            //if token name is the same, this transfer has to be redeemed
            if(redeem(ABDKMathQuad.fromUInt(token), sender, "redeem", address(this)))
                return true;
            else
                return false;
        }
        else if(factory.getType(receiver)=="ViaCash" || factory.getType(receiver)=="ViaBond"){
           _transfer(sender, receiver, token);
           return true;
        }
        else{
            //else, tokens are being sent to another user's account
            //sending contract should be allowed by token owner to make this transfer
            if(redeem(ABDKMathQuad.fromUInt(token), sender, "transfer", receiver))
                return true;
            else
                return false;
        } 
    }
    
    //requesting redemption of Via cash token and transfer of currency it was issued against
    //operation parameter indicates whether it is a redemption or a transfer of deposits from one party to another
    function redeem(bytes16 amount, address party, bytes32 operation, address receiver) private returns(bool){
        bool found = false;         
        for(uint i=0; i<tokens.length && ABDKMathQuad.toUInt(amount)>0; i++){   
            //check if currency in which redemption is to be done has sufficient issued balance for the deposited currency
            if(ABDKMathQuad.cmp(L1deposits[party][tokens[i].tokenName].issuedAmount, amount)>=0){
                bytes16 value = ABDKMathQuad.mul(ABDKMathQuad.div(amount, L1deposits[party][tokens[i].tokenName].issuedAmount),L1deposits[party][tokens[i].tokenName].depositAmount);
                L1deposits[party][tokens[i].tokenName].depositAmount = ABDKMathQuad.sub(L1deposits[party][tokens[i].tokenName].depositAmount, value);
                L1deposits[party][tokens[i].tokenName].issuedAmount = ABDKMathQuad.sub(L1deposits[party][tokens[i].tokenName].issuedAmount, amount);
                require(!lock);
                lock = true;
                if(operation=="redeem"){
                    //adjust total supply
                    _burn(party, ABDKMathQuad.toUInt(amount));
                    //send redeemed ether to party
                    if(tokens[i].tokenName=="ether"){
                        address(uint160(party)).transfer(ABDKMathQuad.toUInt(value));
                    }
                    else{
                        ERC20(tokens[i].tokenAddress).transfer(party, ABDKMathQuad.toUInt(value));
                    }
                    //generate event
                    emit CashRedeemed(party, tokens[i].tokenName, ABDKMathQuad.toUInt(value));
                }
                else if(operation=="transfer"){
                    //check if any fee is payable on remittance and acceptance and pay it if that is the case
                    (amount, value) = payTransferFee(amount, value, tokens[i].tokenName);
                    //transfer balances
                    _burn(party, ABDKMathQuad.toUInt(amount));
                    _mint(receiver, ABDKMathQuad.toUInt(amount));
                    //transfer deposits
                    L1deposits[receiver][tokens[i].tokenName].depositAmount = ABDKMathQuad.add(L1deposits[receiver][tokens[i].tokenName].depositAmount, value);
                    //transfer issued amounts
                    L1deposits[receiver][tokens[i].tokenName].issuedAmount = ABDKMathQuad.add(L1deposits[receiver][tokens[i].tokenName].issuedAmount, amount);                    
                    emit CashTransfer(party, receiver, tokens[i].tokenName, ABDKMathQuad.toUInt(amount));
                }
                amount = 0;
                found = true;
                lock = false;
            }
            //amount to redeem is more than what is in deposit, so we need to remove deposit after redemption
            else if(ABDKMathQuad.cmp(L1deposits[party][tokens[i].tokenName].issuedAmount, 0)>0){
                require(!lock);
                lock = true;
                if(operation=="redeem"){
                    //adjust total supply
                    _burn(party, ABDKMathQuad.toUInt(L1deposits[party][tokens[i].tokenName].issuedAmount));
                    //check if any fee is payable on redemption and pay it if that is the case
                    bytes16 value = L1deposits[party][tokens[i].tokenName].depositAmount;
                    //send redeemed ether to party which is all of the ether in deposit with this user (party)
                    if(tokens[i].tokenName=="ether"){    
                        address(uint160(party)).transfer(ABDKMathQuad.toUInt(value));
                    }
                    else{
                        ERC20(tokens[i].tokenAddress).transfer(party, ABDKMathQuad.toUInt(value));
                    }                    
                    //generate event
                    emit CashRedeemed(party, tokens[i].tokenName, ABDKMathQuad.toUInt(value));
                }
                else if(operation=="transfer"){
                    //check if any fee is payable on remittance and acceptance and pay it if that is the case
                    (bytes16 amt, bytes16 value) = payTransferFee(L1deposits[party][tokens[i].tokenName].issuedAmount, L1deposits[party][tokens[i].tokenName].depositAmount, tokens[i].tokenName);
                    //transfer balances
                    _burn(party, ABDKMathQuad.toUInt(amt));
                    _mint(receiver, ABDKMathQuad.toUInt(amt));
                    //transfer deposits
                    L1deposits[receiver][tokens[i].tokenName].depositAmount = ABDKMathQuad.add(L1deposits[receiver][tokens[i].tokenName].depositAmount, value);
                    //transfer issued amounts
                    L1deposits[receiver][tokens[i].tokenName].issuedAmount = ABDKMathQuad.add(L1deposits[receiver][tokens[i].tokenName].issuedAmount, amt);
                    emit CashTransfer(party, receiver, tokens[i].tokenName, ABDKMathQuad.toUInt(amt));
                }
                //calculate remaining amount to redeem or transfer
                amount = ABDKMathQuad.sub(amount, L1deposits[party][tokens[i].tokenName].issuedAmount);
                //make deposit and issued amount balances zero for ether
                delete L1deposits[party][tokens[i].tokenName];
                found = true;
                lock = false;
            }
        }
        return found;
    }

    function payTransferFee(bytes16 amount, bytes16 value, bytes32 currency) private returns (bytes16, bytes16){
        bytes16 fees = ABDKMathQuad.fromUInt(rates.getFee("remittance"));
        if(ABDKMathQuad.cmp(fees,0)==1){
            address feeTo = rates.getFeeToSetter();
            if(feeTo!=address(0x0)){
                transfer(feeTo, ABDKMathQuad.toUInt(ABDKMathQuad.mul(fees, amount)));
                amount = ABDKMathQuad.sub(amount, ABDKMathQuad.mul(fees, amount));
                L1deposits[feeTo][currency].depositAmount = ABDKMathQuad.add(L1deposits[feeTo][currency].depositAmount, ABDKMathQuad.mul(fees, value)); 
                value = ABDKMathQuad.sub(value, ABDKMathQuad.mul(fees, value));
            }
        }
        return (amount, value);
    }    

    function pause() onlyOwner public {
        _pause();
    }
    function unpause() onlyOwner public {
        _unpause();
    }

}

